import './Actif.css';
import ReturnTitle from './Title';
import CalenderActif from './Calender/Main';
import { useReactToPrint } from 'react-to-print';

// Actif Return Component
export default function ReturnActif() {
 return (
  <div>
   <ReactToPrint
    trigger={() => { return <button>print the table</button> }}

    content={() => this.componentRef}
    documentTitle='new document'
    pageStyle='print'
    onAfterPrint={() => { console.log('document print') }}
   />

   <div ref={el => (this.componentRef = el)} className='wrp-actif'>
    <ReturnTitle />
    <CalenderActif />
   </div>
  </div>
 );
};
